import React from 'react';
import {Route} from 'react-router-dom'
import BlogPage from './components/Blog.js';


const AdminRoutes = (props) => {
    return ( <>
        
        <Route path={`${props.match.path}`} exact component={BlogPage}/>
    </> );
}
 
export default AdminRoutes;
